import React from 'react';
import { NavLink } from 'react-router-dom';
import Menu from '@iso/ui/Antd/Menu/Menu';

import { LOGIN_PAGE, REGISTRATION_PAGE } from '../../../settings/constant';

const AuthMenu = ({ className }) => {

const iconStyle = {
  color: 'blue',
};
  return (
    <Menu className={className}>
      <Menu.Item key="0">
        <NavLink to={LOGIN_PAGE} style={{marginRight:"5px"}}>Đăng nhập</NavLink>
      </Menu.Item>
      <Menu.Item key="1">
        <NavLink to={REGISTRATION_PAGE}>Đăng kí</NavLink>
      </Menu.Item>
      <ion-icon name="cart-outline"></ion-icon>
      <Menu.Item key="2">
        <NavLink to={REGISTRATION_PAGE}><i className="ion-cash" style={iconStyle}/></NavLink>
      </Menu.Item>
    </Menu>
  );
};

export default AuthMenu;
